@import "../helpers/variables.scss";

.portfolio {
  overflow: hidden;
  & > ul {
    display: grid;
    grid-template-columns: repeat(6, 1fr);

    & > li {
      position: relative;

      & > a {
        height: 100%;
        &:hover:before {
          opacity: 0.1;
        }

        &::before {
          transition: 0.2s linear;
          content: "";
          display: inline-block;
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
